def preprocess(data_file, is_training = True):
    """Apply preprocessing and featurization steps to each file in the data directory.

    Your preprocessing and feature generation goes here.

    We've added some basic temporal features as an example.
    """
    logger.info(f"running preprocess on {data_file}")

    # read the data file
    df = pd.read_csv(
        data_file,
        parse_dates=[
            0,
        ],
    )

    logger.info(f"data read from {data_file} has shape of {df.shape}")
    job_hour(df,'WORK_NO')    #work no 
    dt = df.Work_DateTime.dt
    df["days"] = dt.day
    df['year'] = dt.year
    df['date'] = dt.date
    #sunrise,sunset
    df['sunrise'] = 0
    df['sunset'] = 0
    unique_df = pd.DataFrame(df['date'].unique(),columns=['date'])
    df = df.set_index('date')         # for updating the date 
    unique_df['sunrise'] = unique_df['date'].swifter.apply(sunrise)
    unique_df['sunset'] = unique_df['date'].swifter.apply(sunset)
    unique_df = unique_df.set_index('date')
    df.update(unique_df)
    df = df.reset_index(drop=True)

    df['year_no'] = df['EmpNo_Anon'].apply(year_des) #the year the employee started the jobm from 2014
    df['year_num'] = df['year']-df['year_no']  # the years worked while doing the crrent job

    df['month'] = dt.month
    df["hour"] = dt.hour

    df['days_worked'] = df[['year','EmpNo_Anon','month']].apply(looper,axis=1) #number of days worked in a month
    df['diff_shift'] = df[["hour",'EmpNo_Anon']].apply(funcc,axis=1)  #0 if employee works on his regular shift else 1

    df["EmpNo_Anon"] = df["EmpNo_Anon"].astype('int')
    df["EmpNo_Anon"] = df["EmpNo_Anon"].astype('string')
    # Work descriptions have high cardinality, but machine learning works best with a limited number of categories. We take the most common work descriptions and name the rest "Other".
    df['WORK_DESCC'] = df["WORK_DESC"].apply(work_alpha)
    df['WORK_DESCCC'] = df["WORK_DESCC"].apply(double_mgmt)
    df["WORK_DESC_top"] = df["WORK_DESCCC"].apply(top_work_desc_feat)
    df["WORK_DESC"] = df["WORK_DESC_top"]
    df["WORK_nos"] = df["work_no"].apply(work_no_feat)
    df["WORK_NO"] = df["WORK_nos"]
    # Add some time features. See https://pandas.pydata.org/docs/reference/api/pandas.Series.dt.html and https://pandas.pydata.org/pandas-docs/stable/user_guide/timeseries.html
    df["EmpNo"] = df["EmpNo_Anon"].apply(EmpNo_Anon_categorical)
    df["EmpNo_Anon"] = df["EmpNo"]

    df["sleep_hour"] = df["hour"].apply(sleep_hour)

    df["month"] = dt.month
    df["season"] = df["month"].apply(season)

    # Was the day a Western Australia public holiday?
    df["holiday"] = dt.round("1D").isin(wa_hols)
    
    print(df["days_worked"].head(30))
    ##the code for the sunrise sunset is here
    print(df.isnull().sum())
    # df['dark']= df[['sunrise','sunset','hour']].swifter.apply(dark_or_not,axis=1)
    logger.info(f"data after preprocessing has shape of {df.shape}")
    if is_training:
        return df[input_cols + ['incident']]
    else:
        return df[input_cols]


